What is White Genocide? It's not as simple as mass murder, but it's "Slow Boiling the Frog," in our case. Let's take a closer look:

Convention on the Prevention and Punishment of the Crime of Genocide (CPPCG), which was adopted by the United Nations General Assembly on 9 December 1948, as General Assembly Resolution 260:

Article 2 of the convention defines genocide as any of the following acts committed with intent to destroy, in whole or in part, a national, ethnical, racial or religious group, as such:

(a) Killing members of the group;

(b) Causing serious bodily or mental harm to members of the group;

(c) Deliberately inflicting on the group conditions of life calculated to bring about its physical destruction in whole or in part;

(d) Imposing measures intended to prevent births within the group;

(e) Forcibly transferring children of the group to another group.

Article 3 defines the crimes that can be punished under the convention:

(a) Genocide;

(b) Conspiracy to commit genocide;

(c) Direct and public incitement to commit genocide;

(d) Attempt to commit genocide;

(e) Complicity in genocide.

